import React from "react";

class SignIn extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      email: "",
      password: "",
    };
  }
  render() {
    return (
      <StyledSignIn>
        <h2>I already have an account</h2>
        <span>Sign in with your email and password</span>
      </StyledSignIn>
    );
  }
}

const StyledSignIn = styled.div``;

export default SignIn;
